import React, { useState } from 'react';
import ReactPlayer from 'react-player';
import './image_video_processor.css';
import logo1 from './sbl_logo.png';
import logo2 from './lf.png';

const ImageVideoProcessor = () => {
  const [imageFile, setImageFile] = useState(null);
  const [videoFile, setVideoFile] = useState(null);
  const [processedVideoUrl, setProcessedVideoUrl] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState('');

  const handleImageChange = (e) => {
    setImageFile(e.target.files[0]);
  };

  const handleVideoChange = (e) => {
    setVideoFile(e.target.files[0]);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsLoading(true);
    setError('');
    setProcessedVideoUrl('');

    const formData = new FormData();
    formData.append('image_file', imageFile);
    formData.append('video_file', videoFile);

    try {
      const response = await fetch('http://localhost:5000/process_image_video', {
        method: 'POST',
        body: formData,
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      const fullVideoUrl = `http://localhost:5000${data.video_url}`;
      setProcessedVideoUrl(fullVideoUrl);
      console.log("Received processed video URL:", fullVideoUrl);
    } catch (err) {
      setError(`Error processing media: ${err.message}`);
      console.error(err);
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="image-video-processor">
      <div className="logo-container">
        <img src={logo1} alt="SBL Logo" style={{ height: '50px', width: '50px' }} />
        <img src={logo2} alt="LF Logo" style={{ height: '50px', width: '50px' }} />
      </div>

      <h1 className="main-title">
        <span className="icon">üé•</span>
        Image Video Processor
      </h1>

      <form onSubmit={handleSubmit} className="media-input-form">
        <div className="file-input-container">
          <label htmlFor="image" className="file-input-label">Upload Image:</label>
          <input
            type="file"
            id="image"
            accept="image/*"
            onChange={handleImageChange}
            required
            className="file-input"
          />
        </div>

        <div className="file-input-container">
          <label htmlFor="video" className="file-input-label">Upload Video (.mp4):</label>
          <input
            type="file"
            id="video"
            accept="video/mp4"
            onChange={handleVideoChange}
            required
            className="file-input"
          />
        </div>

        <button 
          type="submit" 
          disabled={isLoading}
          className={`submit-button ${isLoading ? 'uploading' : ''}`}
        >
          {isLoading ? 'Processing...' : 'Submit'}
        </button>
      </form>

      {error && <p className="status-message error">{error}</p>}

      {processedVideoUrl && (
        <div className="video-section">
          <h2 className="section-title">
            <span className="icon">üéûÔ∏è</span>
            Processed Video
          </h2>
          <ReactPlayer 
            url={processedVideoUrl} 
            controls={true} 
            width="100%"
            height="auto"
            onError={(e) => {
              console.error("Processed video playback error:", e);
              setError(`Failed to load processed video. Please check the URL and ensure the video file exists. Error: ${e.message}`);
            }}
          />
        </div>
      )}
    </div>
  );
};

export default ImageVideoProcessor;





















